query MatchOverSummaryQuery($key: String!, $pageKey: String) {
  cricket_match_over_summary(match_key: $key, page_key: $pageKey) {
    summaries {
      index {
        innings
        over_number
        __typename
      }
      runs
      wickets
      strikers {
        player_key
        score {
          runs
          balls
          fours
          sixes
          dot_balls
          strike_rate
          __typename
        }
        is_dismissed
        __typename
      }
      bowlers {
        player_key
        score {
          balls
          runs
          economy
          wickets
          extras
          maiden_overs
          overs
          balls_breakup {
            dot_balls
            wides
            no_balls
            fours
            sixes
            __typename
          }
          __typename
        }
        __typename
      }
      match_score {
        runs
        wickets
        run_rate
        title
        req_run_rate
        req_balls
        req_runs
        __typename
      }
      __typename
    }
    previous_page_index {
      innings
      over_number
      __typename
    }
    next_page_index {
      innings
      over_number
      __typename
    }
    previous_page_key
    next_page_key
    __typename
  }
}
